script: |
  super -f text -I q6609.spq | sort > q6609.out

inputs:
  - name: q6609.spq
    data: |
      SELECT DISTINCT - 72 / col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - 98 + + col1 BETWEEN ( col0 ) AND ( - 65 + + CAST ( 63 AS INTEGER ) );
  - name: tab1

outputs:
  - name: q6609.out
    data: |
      -1
      0
